from bisect import bisect_left

def calculate_coverage_area(antenna_data):
    cno = 2
    n = len(antenna_data)
    if n == 0:
        return (cno, 0.0)
    (tbl, xx, yy) = ([], set(), set())
    for (x, y, r) in antenna_data:
        (x, y, r) = (int(100 * x), int(100 * y), int(100 * r))
        (x1, y1, x2, y2) = (x - r, y - r, x + r, y + r)
        tbl.append((x1, y1, x2, y2))
        xx.add(x1)
        xx.add(x2)
        yy.add(y1)
        yy.add(y2)
    xx = sorted(xx)
    yy = sorted(yy)
    arr = [[0 for _ in range(201)] for _ in range(201)]
    for (x1, y1, x2, y2) in tbl:
        l = bisect_left(xx, x1)
        r = bisect_left(xx, x2)
        u = bisect_left(yy, y1)
        d = bisect_left(yy, y2)
        for y in range(u, d):
            for x in range(l, r):
                arr[y][x] = 1
    ans = 0
    for r in range(1, len(yy)):
        t = yy[r] - yy[r - 1]
        for c in range(1, len(xx)):
            if arr[r - 1][c - 1]:
                ans += t * (xx[c] - xx[c - 1])
    ans //= 100
    coverage_area = ans / 100.0
    return (cno, f'{coverage_area:.2f}')

